,"Club obtained the Motivate Award in Shenzhen Regional, the Second Prize in Chongqing Regional, the","PTC Design Award, and received an invitation to World Championship in Australia held by Macquarie","University. SFLS Association for Science and Exploring won the Think Award in Shenzhen Regional, the","Third Prize in Chongqing Regional and the Second Prize in National Final."]}],[{"start":{"row":15,"column":109},"end":{"row":16,"column":0},"action":"remove","lines":["",""],"id":3}],[{"start":{"row":15,"column":109},"end":{"row":15,"column":110},"action":"insert","lines":[" "],"id":4}],[{"start":{"row":32,"column":100},"end":{"row":33,"column":0},"action":"remove","lines":["",""],"id":5},{"start":{"row":31,"column":97},"end":{"row":32,"column":0},"action":"remove","lines":["",""]},{"start":{"row":30,"column":98},"end":{"row":31,"column":0},"action":"remove","lines":["",""]},{"start":{"row":29,"column":95},"end":{"row":30,"column":0},"action":"remove","lines":["",""]},{"start":{"row":28,"column":62},"end":{"row":29,"column":0},"action":"remove","lines":["",""]},{"start":{"row":27,"column":104},"end":{"row":28,"column":0},"action":"remove","lines":["",""]},{"start":{"row":26,"column":90},"end":{"row":27,"column":0},"action":"remove","lines":["",""]},{"start":{"row":25,"column":95},"end":{"row":26,"column":0},"action":"remove","lines":["",""]},{"start":{"row":24,"column":92},"end":{"row":25,"column":0},"action":"remove","lines":["",""]},{"start":{"row":23,"column":96},"end":{"row":24,"column":0},"action":"remove","lines":["",""]},{"start":{"row":22,"column":98},"end":{"row":23,"column":0},"action":"remove","lines":["",""]},{"start":{"row":21,"column":103},"end":{"row":22,"column":0},"action":"remove","lines":["",""]},{"start":{"row":20,"column":95},"end":{"row":21,"column":0},"action":"remove","lines":["",""]},{"start":{"row":19,"column":99},"end":{"row":20,"column":0},"action":"remove","lines":["",""]},{"start":{"row":18,"column":94},"end":{"row":19,"column":0},"acti